import React from 'react';
import navigate  from 'react-router-dom';


const Header = () => {
  return (
    <header className="flex justify-between items-center p-4 pl-12 bg-gray-100 shadow-md">
      {/* Left Side: Profile Image + Name */}
      <div className="flex items-center space-x-8">
        {/* Circle Image Placeholder */}
        <div className="w-12 h-12 rounded-full bg-gray-300 overflow-hidden transition-transform duration-300 hover:scale-[1.2]">
        <img
            src="/images/rhys_2.jpg"
            alt="Profile"
            className="w-full h-full object-cover"
            onClick={() => navigate("/about")}
        />
        </div>

        <span className="text-xl font-semibold text-gray-800 hover:scale-[1.2]" onClick={() => navigate("/about")}>Rhys Smith</span>
      </div>

      {/* Right Side: Nav Buttons */}
      <nav className="flex space-x-6">
        <button className="text-gray-700 hover:text-indigo-600 transition">Home</button>
        <button className="text-gray-700 hover:text-indigo-600 transition">About</button>
        <button className="text-gray-700 hover:text-indigo-600 transition">Projects</button>
        <button className="text-gray-700 hover:text-indigo-600 transition">Contact</button>
      </nav>
    </header>
  );
};

export default Header;
